import React, { useEffect, useState } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { registerUser } from '../store/AuthSlice'
import { StyleFrom } from '../style/StyleForm'
import { useNavigate } from 'react-router'
import styled from "styled-components";
imp


function Register() {



    const dispatch = useDispatch()
    const auth = useSelector((state)=>state.auth)
    const navigate = useNavigate()

    console.log(auth)


    useEffect(()=>{
      if(auth._id){
        navigate("/cart")
      }
    },[auth._id, navigate])

    const [user,setUser] = useState({
        name:"",
        email:"",
        password:""
    })


    const handleSubmit = (e)=>{
            e.preventDefault()

            dispatch(registerUser(user))
    }


  return (
    <>

    <form className='form' onSubmit={handleSubmit}>
        <h2>Register</h2>
        <input type='text' name='' placeholder='Name' onChange={(e)=>setUser({...user,name:e.target.value})}/>
        <input type='email' name='' placeholder='Email' onChange={(e)=>setUser({...user,email:e.target.value})}/>
        <input type='password' name='' autoComplete="on" placeholder='Password' onChange={(e)=>setUser({...user,password:e.target.value})}/>
        <button> {auth.registerStatus === "pending" ? "Submitting" : "Register"}</button>

        {auth.registerStatus === "rejected" ?  <p>{auth.registerError}</p> : null}
    </form>

    </>
  )
}

export default Register
